components:
  responses:
    '401':
      description: "Authentication failure : Confirm you have a valid key.  \n<br/>[[Web Standards](https://developer.mozilla.org/en-US/docs/Web/HTTP/Status/401) for reference]"
    '403':
      description: "Access not allowed : Verify your key and subscription level.  \n[[Web Standards](https://developer.mozilla.org/en-US/docs/Web/HTTP/Status/403) for reference]"
    '404':
      description: "Resource not found : Check the URL in your request.  \n[[Web Standards](https://developer.mozilla.org/en-US/docs/Web/HTTP/Status/404) for reference]"
    '406':
      description: "Not acceptable : Parameters not speficied correctly.  \n[[Web Standards](https://developer.mozilla.org/en-US/docs/Web/HTTP/Status/406) for reference]"
    '500':
      description: "Unexpected Server error : Try again later.  \n[[Web Standards](https://developer.mozilla.org/en-US/docs/Web/HTTP/Status/500) for reference]"
  parameters:
    Token:
      name: Authorization
      in: header
      required: true
      schema:
        type: string
        example: ApiKey sd8ds.sdf93d09sd3d
    Filters:
      name: filters
      in: query
      description: Set of filter expressions to subset the data (see example of JSON object below)
      schema:
        type: array
        items:
          type: object
          properties:
            AttributeName:
              type: string
              description: Name of the filterable dimension attribute (see response schema)
            Values:
              type: array
              description: Array of values that form the selection
      examples:
        Single filter example:
          value:
            - AttributeName: Dimension Attribute Name
              Values:
                - Value1
                - Value2
    Size:
      name: size
      in: query
      description: Number of values to return per page. Should be greater than zero.
      schema:
        type: integer
    Cursor:
      name: cursor
      in: query
      description: The forward-only cursor to access paginated responses (i.e. when results exceed size parameter)
      schema:
        type: string
  securitySchemes:
    ApiKey:
      type: http
      description: Append the token issued by o9 to the word ApiKey e.g. 'ApiKey sd8ds.sdf93d09sd3d'
      scheme: bearerFormat
tags:
  - name: Consumer Metrics
    description: 'Information that describe consumer demographics, behavior as well as sentiment / expectations'
  - name: Events
    description: Cultural and other events
  - name: Market Activity
    description: Indicators of economic and commercial activity; primarily time series
  - name: Market Structure
    description: The organisation of global commerce and supply chains
  - name: Weather
    description: Weather history and forecast
  - name: Unknown